import React,{Component} from 'react'
class Footer extends Component{
  constructor(props){
    super(props);
    this.state={
      matches:window.matchMedia('(')
    };
  }
  render(){
    const footer={
      display:'flex',
      flexWrap:'wrap',
      backgroundColor:'black',
      height:'200px'
    };
    return(
      <>
      <section style={footer}>
        <div>akkj</div>
        <div>ndj</div>
        <div>jsk</div>
        <div>kls</div>
      </section>
      </>
    );
  }
}
export default Footer;
